INSERT INTO `notes__units` (`id`, `course_id`, `unit_name`, `unit_description`, `unit_application`, `unit_importantQuestions`, `unit_reference`, `unit_author_name`, `unit_author_email`, `published`, `created_at`, `updated_at`) VALUES
(1, 67, 'Introduction to Intelligence and Artificial Intelligence', '<ol>\r\n<li>The first definition we see by Mr. Elaine Rich (the author of the &lsquo;Artificial Intelligence&rsquo;).\r\n<ol>\r\n<li>According to Elaine Rich -<em> computers are better than human beings in numerical computation, storing information for long time and repetition of work. Humans are better than computers in understanding the concept, prediction on the basis of pattern of system and logical reasoning.</em></li>\r\n<li>In simple words, computers work better than human in performing sequential tasks with fast computation. On the other side, humans work better than computers in performing task parallel manner that is also known as parallel processing.</li>\r\n<li>Computers find difficulties in figuring out the context of input such as, <em>&lsquo;It&rsquo;s been a long time,&rsquo;. </em>Contextual information is important for computers to understand visual, speech inputs. For example, &lsquo;<em>For a long time&rsquo; </em>could be few hours or could be millions of years. It depends on contextual information.</li>\r\n</ol>\r\n</li>\r\n<li>The Second definition is given by Mr. Buchanin and Shortliffe.\r\n<ol>\r\n<li>According to Mr. Buchanin and Shortliffe &ndash; <em>&ldquo;AI is the branch of computer science that deal with symbolic rather than numeric processing and non-algorithmic method including the rules of thumb or heuristics instead of algorithms as technique for solving problem.&rdquo;</em></li>\r\n<li>Number processing deals with athematic operations with definite relation, whereas symbol deals with context of having number, character, special character to make decision. For example, in numeric processing: 164 is greater than 28 which is true but 5&rsquo;7 height person is older than 5&rsquo;4 height person we cannot surely say that it is true.</li>\r\n<li>Algorithm approach is similar to recipe which has well defined starting and ending points. In computers, solution to any problem is called algorithm.</li>\r\n<li>Difficult problem that cannot be solved with algorithmic approach. Those problems can be solved with non-algorithmic approach such as <strong>Neural Network</strong>. Besides Neural Network, there is one more approach called symbolic approach.</li>\r\n<li>Symbolic approach works on exploitation/manipulation of the knowledge of the domain. Some of this knowledge, generally called <strong>heuristics </strong>in Artificial Intelligence.</li>\r\n<li>In Artificial Intelligence, guesses are called <strong>heuristics</strong>.</li>\r\n</ol>\r\n</li>\r\n<li>Another definition by Mr. Elaine Rich\r\n<ol>\r\n<li>According to Mr. Rich &ndash; <em>Artificial Intelligence is the study of techniques for solving exponentially hard problem in polynomial time by exploiting knowledge about the problem domain.</em></li>\r\n<li>In this comment, Mr. Rich concerned about time and space complexity of the problem, exponential time complexity is considered as impractical amount of time from computation point of view whereas polynomial time takes reasonable amount of time which is good alternate to exponential time.</li>\r\n</ol>\r\n</li>\r\n<li>Definition by Mr. Barr and Feigenbaum\r\n<ol>\r\n<li>According to Barr, AI is the part of computer concerned with designing intelligent system. Systems that exhibit the characteristics we associate with intelligence in human behavior.</li>\r\n</ol>\r\n</li>\r\n<li>Definition by Mr. Shalkoff\r\n<ol>\r\n<li>According Mr. Shalkoff &ndash;<em> Artificial Intelligence is a field of study that seeks to explain and emulate intelligent behavior in terms of computational processes.</em></li>\r\n<li>Artificial Intelligence is considered as partly engineering and partly scientific.</li>\r\n<li>Engineering is defined as the science and mathematics application which is useful to man in structure, meeting some requirements and according to some specifications.</li>\r\n<li>In Mr. Shalkoff&rsquo;s words, through application of AI products are obtained that exhibit intelligent behavior, how to judge/evaluate whether a product obtained through an application of AI is actually intelligent.</li>\r\n</ol>\r\n</li>\r\n</ol>\r\n<p>Mr. Alan Turning suggested a turing test is best testing approach for AI products.</p>', '<p><strong>Uses/Application</strong></p>\r\n<ol>\r\n<li>As discussed above, algorithmic approach has limitation that can be resolved by Artificial Intelligence approach using symbol processing and neural networks.</li>\r\n<li>In general, we use artificial intelligence in pattern recognition, disease diagnosis, market value prediction, etc.</li>\r\n<li>Most importantly for user interaction and instant response of unstructured queries. &nbsp;&nbsp;</li>\r\n</ol>', '<ol>\r\n<li>What is the purpose of Turing test? Give a brief outline of the Turing test? What are the objections to the Turing test?</li>\r\n<li>What is the purpose of Chinese Room test? Give a brief outline of Chinese? How did the outcomes of the Chinese Room Test contribute in the development of machine intelligence?</li>\r\n</ol>', '<ol>\r\n<li>For more information kindly IGNOU book : <a href=\"https://drive.google.com/file/d/0ByLYiCci-v9qMmJjYmQwMzEtMmFkMC00OTc3LWIyNjYtYjMxMTgyZGRjZTc0/view?hl=en\">https://drive.google.com/file/d/0ByLYiCci-v9qMmJjYmQwMzEtMmFkMC00OTc3LWIyNjYtYjMxMTgyZGRjZTc0/view?hl=en</a></li>\r\n<li>Rich E. &amp; Knight K. (1991) Artificial Intelligence : <a href=\"https://i4iam.files.wordpress.com/2013/08/artificial-intelligence-by-rich-and-knight.pdf\">https://i4iam.files.wordpress.com/2013/08/artificial-intelligence-by-rich-and-knight.pdf</a></li>\r\n</ol>', 'Deepak', 'Deepakkumaratariya@gmail.com', 0, NULL, NULL);
